#[wasm_bindgen]
impl Universe { // ... pub fn width(&self) -> u32 { self.width } pub fn height(&self) -> u32 { self.height } pub fn cells(&self) -> *const Cell { self.cells.as_ptr() }
} Next, let's define some constants just under the import line that JavaScript will use when rendering the canvas: import { Universe } from "./wasm_game_of_life"; const CELL_SIZE = 5; // px
const GRID_COLOR = "#CCCCCC";
const DEAD_COLOR = "#FFFFFF";
const ALIVE_COLOR = "#000000"; // These must match `Cell::Alive` and `Cell::Dead` in `src/lib.rs`.
const DEAD = 0;
const ALIVE = 1; Now, let's rewrite our current JS code (except for the import) to no longer write to the <pre> but instead draw to the <canvas> : // Construct the universe, and get its width and height.
