}; We can directly access WebAssembly's linear memory via memory , which is defined in the raw wasm module wasm_game_of_life_bg . To draw the cells, we get a pointer to the universe's cells, construct a Uint8Array overlaying the cells buffer, iterate over each cell, and draw a white or black rectangle depending on whether the cell is dead or alive, respectively. By working with pointers and overlays, we avoid copying the cells across the boundary on every tick. // Import the WebAssembly memory at the top of the file.
import { memory } from "./wasm_game_of_life_bg"; // ... const getIndex = (row, column) => { return row * width + column;
}; const drawCells = () => { const cellsPtr = universe.cells(); const cells = new Uint8Array(memory.buffer, cellsPtr, width * height); ctx.beginPath(); for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); ctx.fillStyle = cells[idx] === DEAD ? DEAD_COLOR : ALIVE_COLOR; ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); } } ctx.stroke();
}; To start the rendering process, we'll use the same code as above to start the first iteration of the rendering loop: requestAnimationFrame(renderLoop);

