The performance.now() function returns a monotonic timestamp measured in milliseconds since the Web page was loaded. We can use it to time various operations, and we can access it from Rust with the following wasm_bindgen import declaration: #[wasm_bindgen]
extern { #[wasm_bindgen(js_namespace = performance)] fn now() -> f64;
} Calling performance.now has very little overhead, so we can create simple measurements from it without distorting the performance of the rest of the system. For example, we can create a simple frames per second (FPS) counter that we update on each iteration of our renderLoop . We start by adding an fps object to index.js : const fps = new class { constructor() { this.fps = document.getElementById("fps"); this.frames = []; this.lastFrameTimeStamp = performance.now(); } render() { // Convert the delta time since the last frame render into a measure // of frames per second. const now = performance.now(); const delta = now - this.lastFrameTimeStamp; this.lastFrameTimeStamp = now; const fps = 1 / delta * 1000; // Save only the latest 100 timings. this.frames.push(fps); if (this.frames.length > 100) { this.frames.shift(); } // Find the max, min, and mean of our 100 latest timings. let min = Infinity; let max = -Infinity; let sum = 0; for (let i = 0; i < this.frames.length; i++) { sum += this.frames[i]; min = Math.min(this.frames[i], min); max = Math.max(this.frames[i], max); } let mean = sum / this.frames.length; // Render the statistics. this.fps.textContent = `
Frames per Second: latest = ${Math.round(fps)}
avg of last 100 = ${Math.round(mean)}
min of last 100 = ${Math.round(min)}
max of last 100 = ${Math.round(max)}
`.trim(); }
}; Next we call the fps render function on each iteration of renderLoop : const renderLoop = () => { fps.render(); //new universe.tick(); drawCells(); drawGrid(); animationId = requestAnimationFrame(renderLoop);
}; Finally, don't forget to add the fps element to index.html : <div id="fps"><div> And Voila! Now you have an FPS counter!

