The console.time and console.timeEnd functions allow you to log the timing of named operations to the browser's developer tools console. You can import them into Rust with this wasm-bindgen declaration: #[wasm_bindgen]
extern { #[wasm_bindgen(js_namespace = console)] fn time(name: &str); #[wasm_bindgen(js_namespace = console)] fn timeEnd(name: &str);
} Because there should be a corresponding console.timeEnd invocation for every console.time call, it is convenient to wrap them both up in an RAII type: pub struct Timer<'a> { name: &'a str,
